import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {title: 'Eating out', amount: 10000, date: '15-June-2021'},
    {title: 'React course', amount: 5000, date: '10-June-2021'},
    {title: 'Japa Fees', amount: 10000, date: '5-July-2021'},
    {title: 'Tithe', amount: 2000, date: '1-August-2021'},
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem/>
    </div>
  );
}

export default App;
